{
    "presets": ["@babel/preset-env", "@babel/preset-typescript"],
    "plugins": ["@babel/transform-runtime", "@babel/plugin-syntax-dynamic-import"]
}

{
    "singleQuote": true,
    "trailingComma": "all",
    "printWidth": 100,
    "tabWidth": 4
}

{
    "name": "facade/ignition",
    "description": "A beautiful error page for Laravel applications.",
    "keywords": [
        "error",
        "page",
        "laravel",
        "flare"
    ],
    "homepage": "https://github.com/facade/ignition",
    "license": "MIT",
    "require": {
        "php": "^7.2.5|^8.0",
        "ext-json": "*",
        "ext-mbstring": "*",
        "facade/flare-client-php": "^1.9.1",
        "facade/ignition-contracts": "^1.0.2",
        "illuminate/support": "^7.0|^8.0",
        "monolog/monolog": "^2.0",
        "symfony/console": "^5.0",
        "symfony/var-dumper": "^5.0",
        "ext-curl": "*"
    },
    "require-dev": {
        "friendsofphp/php-cs-fixer": "^2.14",
        "livewire/livewire": "^2.4",
        "mockery/mockery": "^1.3",
        "orchestra/testbench": "^5.0|^6.0",
        "psalm/plugin-laravel": "^1.2"
    },
    "suggest": {
        "laravel/telescope": "^3.1"
    },
    "config": {
        "sort-packages": true
    },
    "extra": {
        "branch-alias": {
            "dev-master": "2.x-dev"
        },
        "laravel": {
            "providers": [
                "Facade\\Ignition\\IgnitionServiceProvider"
            ],
            "aliases": {
                "Flare": "Facade\\Ignition\\Facades\\Flare"
            }
        }
    },
    "autoload": {
        "psr-4": {
            "Facade\\Ignition\\": "src"
        },
        "files": [
            "src/helpers.php"
        ]
    },
    "autoload-dev": {
        "psr-4": {
            "Facade\\Ignition\\Tests\\": "tests"
        }
    },
    "minimum-stability": "dev",
    "prefer-stable": true,
    "scripts": {
        "psalm": "vendor/bin/psalm",
        "format": "vendor/bin/php-cs-fixer fix --allow-risky=yes",
        "test": "vendor/bin/phpunit",
        "test-coverage": "vendor/bin/phpunit --coverage-html coverage"
    },
    "support": {
        "issues": "https://github.com/facade/ignition/issues",
        "forum": "https://twitter.com/flareappio",
        "source": "https://github.com/facade/ignition",
        "docs": "https://flareapp.io/docs/ignition-for-laravel/introduction"
    }
}

{
    "private": true,
    "scripts": {
        "dev": "webpack --mode development --watch",
        "build": "NODE_ENV=production webpack --mode production",
        "format": "prettier --write 'resources/**/*.{css,js,ts,vue}'"
    },
    "dependencies": {
        "git-url-parse": "^11.1.2",
        "highlight.js": "^10.4.1",
        "lodash": "^4.17.21",
        "markdown-it": "^12.3.2",
        "md5": "^2.2.1",
        "sql-formatter": "^2.3.3"
    },
    "devDependencies": {
        "@babel/core": "^7.4.5",
        "@babel/plugin-syntax-dynamic-import": "^7.2.0",
        "@babel/plugin-transform-runtime": "^7.4.4",
        "@babel/preset-env": "^7.4.5",
        "@babel/preset-typescript": "^7.3.3",
        "@fullhuman/postcss-purgecss": "^1.1.0",
        "@types/jest": "^24.0.15",
        "@types/lodash": "^4.14.133",
        "babel-loader": "^8.0.6",
        "css-loader": "^3.0.0",
        "husky": "^1.3.1",
        "jest": "^24.8.0",
        "lint-staged": "^8.1.5",
        "postcss-import": "^12.0.1",
        "postcss-loader": "^3.0.0",
        "postcss-preset-env": "^6.6.0",
        "prettier": "^1.16.4",
        "style-loader": "^0.23.1",
        "tailwindcss": "^1.0.4",
        "typescript": "^3.5.2",
        "vue": "^2.6.10",
        "vue-loader": "^15.7.0",
        "vue-template-compiler": "^2.6.10",
        "webpack": "^4.35.0",
        "webpack-cli": "^3.3.5"
    },
    "husky": {
        "hooks": {
            "pre-commit": "lint-staged && yarn build && git add resources/compiled/ignition.js"
        }
    },
    "lint-staged": {
        "linters": {
            "*.{css,js,ts,vue}": [
                "yarn format",
                "git add"
            ]
        },
        "ignore": [
            "resources/compiled/**/*"
        ]
    },
    "jest": {
        "testPathIgnorePatterns": [
            "/node_modules/",
            "/__helpers__/"
        ]
    }
}

const purgecss = require('@fullhuman/postcss-purgecss');

module.exports = {
    plugins: [
        require('postcss-import'),
        require('tailwindcss')('./tailwind.config.js'),
        require('postcss-preset-env')(),
        process.env.NODE_ENV === 'production'
            ? purgecss({
                  content: [
                      './resources/js/**/*.js',
                      './resources/js/**/*.vue',
                      './resources/views/errorPage.php',
                  ],
                  extractors: [
                      {
                          extractor: class {
                              static extract(content) {
                                  return content.match(/[a-zA-Z0-9-:_/]+/g) || [];
                              }
                          },
                          extensions: ['js', 'php', 'vue'],
                      },
                  ],
                  whitelistPatterns: [/hljs/, /sf-dump/, /theme-dark/, /theme-auto/],
              })
            : '',
    ],
};

module.exports = {
    important: true,
    theme: {
        fontFamily: {
            sans: [
                '-apple-system',
                'BlinkMacSystemFont',
                '"Segoe UI"',
                'Roboto',
                '"Helvetica Neue"',
                'Arial',
                '"Noto Sans"',
                'sans-serif',
                '"Apple Color Emoji"',
                '"Segoe UI Emoji"',
                '"Segoe UI Symbol"',
                '"Noto Color Emoji"',
            ],
            mono: [
                'SFMono-Regular',
                'Menlo',
                'Monaco',
                'Consolas',
                '"Liberation Mono"',
                '"Courier New"',
                'monospace',
            ],
        },
        colors: {
            white: 'var(--white)',
            blue: {
                400: 'var(--blue-400)',
            },
            green: {
                100: 'var(--green-100)',
                300: 'var(--green-300)',
                500: 'var(--green-500)',
            },
            purple: {
                100: 'var(--purple-100)',
                200: 'var(--purple-200)',
                300: 'var(--purple-300)',
                400: 'var(--purple-400)',
                500: 'var(--purple-500)',
                600: 'var(--purple-600)',
                800: 'var(--purple-800)',
            },
            red: {
                100: 'var(--red-100)',
                300: 'var(--red-300)',
                400: 'var(--red-400)',
            },
            yellow: {
                100: 'var(--yellow-100)',
                200: 'var(--yellow-200)',
                300: 'var(--yellow-300)',
                400: 'var(--yellow-400)',
            },
            gray: {
                50: 'var(--gray-50)',
                100: 'var(--gray-100)',
                200: 'var(--gray-200)',
                300: 'var(--gray-300)',
                400: 'var(--gray-400)',
                500: 'var(--gray-500)',
                600: 'var(--gray-600)',
                700: 'var(--gray-700)',
                800: 'var(--gray-800)',
            },
            tint: {
                50: 'var(--tint-50)',
                100: 'var(--tint-100)',
                200: 'var(--tint-200)',
                300: 'var(--tint-300)',
                400: 'var(--tint-400)',
                500: 'var(--tint-500)',
                600: 'var(--tint-600)',
                700: 'var(--tint-700)',
            },
        },
        extend: {
            borderWidth: {
                3: '3px',
            },
            boxShadow: {
                sm: 'var(--shadow-sm)',
                default: 'var(--shadow-default)',
                lg: 'var(--shadow-default)',
                input: 'var(--shadow-default)',
            },
            inset: {
                full: '100%',
            },
            maxWidth: {
                '7xl': '80rem',
            },
            minHeight: {
                6: '1.5rem',
                10: '2.5rem',
                12: '3rem',
                full: '100%',
            },
            minWidth: {
                8: '2rem',
            },
            zIndex: {
                1: '1',
            },
            leading: {
                tight: '1.1',
            },
        },
    },
};

const VueLoaderPlugin = require('vue-loader/lib/plugin');

module.exports = {
    entry: {
        ignition: './resources/js/app.js',
    },

    output: {
        path: `${__dirname}/resources/compiled`,
        publicPath: '/',
        filename: '[name].js',
    },

    module: {
        rules: [
            {
                test: /\.(js|tsx?)$/,
                use: 'babel-loader',
                exclude: /node_modules/,
            },
            {
                test: /\.vue$/,
                loader: 'vue-loader',
            },
            {
                test: /\.css$/,
                use: [
                    'style-loader',
                    { loader: 'css-loader', options: { url: false } },
                    'postcss-loader',
                ],
            },
        ],
    },

    plugins: [new VueLoaderPlugin()],

    resolve: {
        extensions: ['.css', '.js', '.ts', '.vue'],
        alias: {
            vue$: 'vue/dist/vue.esm.js',
        },
    },

    stats: 'minimal',

    performance: {
        hints: false,
    },
};
